import React from 'react';
import './App.css';
import Header from './components/Header';
import OnermEntry from './components/OnermEntry';
import PrWarmup from './components/PrWarmup';
import ReverseMax from './components/ReverseMax';
import SetPlanner from './components/SetPlanner';
import Menu from './components/Menu';
import Grid from '@material-ui/core/Grid';

function App() {

  return (
    <div className="App">

    <Header/>

    <Grid
      container
      direction="row"
      justify="center"
      alignItems="center"
    >
    <Grid container item xs={12} spacing={3}>
      <OnermEntry/>
      </Grid>

      <PrWarmup/>
      <ReverseMax/>
      <SetPlanner/>

    </Grid>

    <Menu/>

    </div>
  );
}

export default App;
